using namespace sf;

int main()
{
    // get display resolution
    int monitorWidth = VideoMode::getDesktopMode().width;
    int monitorHeight = VideoMode::getDesktopMode().height;

    int windowWidth = 529;
    int windowHeight = 600;
    int windowX = monitorWidth / 2 - windowWidth / 2;
    int windowY = monitorHeight / 2 - windowHeight / 2;

    RenderWindow window(VideoMode(529, 600), ":3");
    window.setPosition(Vector2i(windowX, windowY));

    Image image;
    image.loadFromMemory(&data, 160918);

    Texture texture;
    texture.loadFromImage(image);

    Sprite rect;
    rect.setTexture(texture);

    float i = 0;

    HWND hWnd = GetConsoleWindow();
    ShowWindow(hWnd, SW_HIDE);

    Image icon;
    icon.loadFromMemory(&iconData, 8310);
    window.setIcon(128, 128, icon.getPixelsPtr());

    while (window.isOpen())
    {

        Event event;
        while (window.pollEvent(event))
        {

            if (event.type == Event::Closed)
                window.close();


        }

        i += 0.1;

        windowX = sin(i) * monitorWidth / 4 + monitorWidth / 2.5;
        windowY = cos(i) * monitorHeight / 4 + monitorHeight / 4;

        window.setPosition(Vector2i(windowX, windowY));

        window.clear();
        window.draw(rect);
        window.display();

        sleep(milliseconds(16));

	}

    return 0;
}